import Dashboard from "./Dashboard";
import FilterStrip from "./FilterStrip";
import Navbar from "./Navbar";
import User from "./User";

const COMPONENTS = {
  Dashboard: Dashboard,
  FilterStrip: FilterStrip,
  Navbar: Navbar,
  User: User
};

export default COMPONENTS;
